import Card from "./Card";
import ExpenseItem from "./ExpensItem";
import "./Expenses.css";

function Expenses(props) {
  return (
    <Card className="expenses">
      <div>
      {props.items.map((item) => {
        return (
          <ExpenseItem
            title={item.title}
            amount={item.amount}
            date={item.date}
          />
        );
      })}
      </div>
    </Card>
  );
}

export default Expenses;
